import React, { Component } from 'react'
import ClientMain from "./components/ClientMain";
import Main from "./components/Main";

export default class App extends Component {

  constructor(props) {
    super(props)

    this.state = {
      version: 1
    }
  }


  render() {
    return (
      <div className="App">
        <ClientMain />
        <span style={{ fontSize: "12px" }} >powered by TixPros - V{this.state.version === 1 ? 2 : 1}</span>
        <button onClick={() => { this.setState({ version: this.state.version === 1 ? 2 : 1 }) }} >Voir la V{this.state.version === 1 ? 2 : 1}</button>
      </div>
    )
  }
}
